CREATE DEFINER=`root`@`localhost` PROCEDURE `update_quiz_status` ()  BEGIN
    IF exists (select quizID from quiz where status='2' and SYSDATE()>=finishDateTime) THEN  
            update quiz set status='3'  
            where quizID in (SELECT * FROM ( select quizID  from quiz where status='2' and SYSDATE()>=finishDateTime)AS a); 
    END IF;  
END$$

